import React from 'react';

import { data } from './../data';

export default function List({ leng }) {

    return (
        <ul className = "list-container">
            {data[leng].projects.map(item =>
                <a 
                href = {Object.keys(item)}
                onClick = {() => set}
                >{Object.keys(item)}</a>)}
        </ul>
    )
}
